import "./App.css";
import axios from "axios";
import { useEffect, useState } from "react";

function App() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    let fetchData = async () => {
      let result = await axios.get(
        "https://jsonplaceholder.typicode.com/users"
      );
    };
  });

  return <div className="App"></div>;
}

export default App;
